import WhyUs from '../../components/home/WhyUs'
import Footer from '../../components/home/Footer'


import styles from '../../styles/home/index.module.scss'

class Home extends Component{

    

    render(){
        return(
            <div>
                <Navbar />
                <NavMobile />
                
                <main>
                    
                    <Header />
                    <WhyUs />            

                </main>

                <Footer />

            </div>
        )
    }
}

export default Home;
